import AppBar from '@mui/material/AppBar';
import Typography from '@mui/material/Typography';

import logo from './images/EZR.png';
import './App.css';

function App() {
  return (



      <AppBar position="static">  

          <Typography
            variant="h6"
            noWrap
            component="a"
            href="/"
            sx={{
              mr: 2,
              display: { xs: 'none', md: 'flex' },
              fontFamily: 'monospace',
              fontWeight: 700,
              letterSpacing: '.3rem',
              color: 'inherit',
              textDecoration: 'none',
            }}
          >
            <img src={logo} className="App-logo" alt="logo" /> 
          </Typography>   
      </AppBar> 




  );
}

export default App;
